script: |
  super -f text -I q3902.spq | sort > q3902.out

inputs:
  - name: q3902.spq
    data: |
      SELECT ALL + 56 AS col2 FROM tab2 (FORMAT parquet) WHERE NOT NULL NOT BETWEEN + col1 + + + col1 * - col0 - - - 4 AND + col1 + col2 + + + 36;
  - name: tab2

outputs:
  - name: q3902.out
    data: |
